Kimber is visiting from out of town and decides to go visit Tim, her long-time friend's bartender brother, whom she hasn't seen in forever. Tim's just about to close up the tavern, but when he finds out how much Kimber has blossomed, he decides to give her the best service he can deliver. Although she only drank a shot of tequila, her night at the bar included a sloppy blowjob, sex on a barstool and a facial.
